import React, { Component } from "reacr";
import "./style.css";

import Input from "../input/Inpit";
import Button from "../button/Button";

class Form extends Component {
  constructor(props) {
    super(props);
    this.state = {
      value: "",
    };
  }
  render() {
    return (
      <form className="form">
        <Input type="text"></Input>
        <Input type="password"></Input>
        <Input type="email"></Input>
        <Button></Button>
      </form>
    );
  }
}

export default Form;
